import React from 'react'
import classNames from "classnames/bind";



function Staff() {
  const [idNhanVien, setIdNhanVien] = useState('');
  const [hoTen, setHoTen] = useState('');
  const [email, setEmail] = useState('');
  const [sdtNv, setSdtNv] = useState('');
  const [ngaySinh, setNgaySinh] = useState('');
  const [diaChi, setDiaChi] = useState('');
  const [ngayVaoLam, setNgayVaoLam] = useState('');
  const [cccd, setCccd] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform form submission or data processing
    // You can use the state variables to access the form data
  };

  return (
    <div>
      <h1>Staff Page</h1>
      <form onSubmit={handleSubmit}>
        <label>ID NHANVIEN:</label>
        <input type="text" value={idNhanVien} onChange={(e) => setIdNhanVien(e.target.value)} />

        <label>HO TEN:</label>
        <input type="text" value={hoTen} onChange={(e) => setHoTen(e.target.value)} />

        <label>EMAIL:</label>
        <input type="text" value={email} onChange={(e) => setEmail(e.target.value)} />

        <label>SDT NV:</label>
        <input type="text" value={sdtNv} onChange={(e) => setSdtNv(e.target.value)} />

        <label>NGAYSINH:</label>
        <input type="text" value={ngaySinh} onChange={(e) => setNgaySinh(e.target.value)} />

        <label>DIACHI:</label>
        <input type="text" value={diaChi} onChange={(e) => setDiaChi(e.target.value)} />

        <label>NGAYVAOLAM:</label>
        <input type="text" value={ngayVaoLam} onChange={(e) => setNgayVaoLam(e.target.value)} />

        <label>CCCD:</label>
        <input type="text" value={cccd} onChange={(e) => setCccd(e.target.value)} />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Staff;
